import React from 'react';
import PokemonList from './components/pokemonList/index';
import { BrowserRouter, Route } from 'react-router-dom';

const App = () => {
  return (
    <BrowserRouter>
      <Route path='/' component={PokemonList}/>
    </BrowserRouter>
  );
}


export default App;
